# @lc code=start
class Solution:
    def minWindow(self, s: str, t: str) -> str:
        dt = {}
        for c in t:
            if c not in dt:
                dt[c] = 0
            dt[c] += 1

        occs = []
        for i in range(len(s)):
            if s[i] in dt:
                occs.append((i, s[i]))

        best_begin = 0
        best_end = len(occs) - 1
        solution_exists = False
        for i in range(len(occs) - len(t) + 1):
            if i % 1000 == 0:
                print(i)
            # i_prefix = ' ' * occs[i][0]
            # print(i_prefix + '> ' + s[occs[i][0]:])
            d = {}
            missing_chars = len(t)
            for j in range(i, len(occs)):
                # print(i_prefix + '< ' + s[occs[i][0] : occs[j][0] + 1])
                _, c = occs[j]
                if c not in d:
                    d[c] = 0
                d[c] += 1
                if d[c] <= dt[c]:
                    missing_chars -= 1
                    if missing_chars == 0:
                        solution_exists = True
                        if occs[j][0] - occs[i][0] < occs[best_end][0] - occs[best_begin][0]:
                            best_begin = i
                            best_end = j
                            # print(i_prefix + '  ^ new best)')
                            break
        if solution_exists:
            return s[occs[best_begin][0] : occs[best_end][0] + 1]
        else:
            return ''

